import React from 'react';
import classes from './Header.module.css';

const Header = () => {
    return (
        <header className={classes.header}>
            <img src='https://s2.coinmarketcap.com/static/img/coins/200x200/2099.png'  alt="Logo"/>
        </header>
    );
}

export default Header;
